import React, { Component } from 'react';
import { Route, Redirect } from 'react-router-dom';
import { isLogged } from 'components/UserFunctions';
const LogRoute = ({ component: Component, layout: Layout, ...rest }) => (
    <Route
        {...rest}
        render={props =>
            !isLogged ? (
                <Layout>
                    <Component {...props} />
                </Layout>
            ) : (
                    <Redirect
                        to={{
                            pathname: "/home"
                        }}
                    />
                )
        }
    />
);
export default LogRoute;
